import React, { Component } from 'react'
import Toolbar from '@material-ui/core/Toolbar';
import Link from '@material-ui/core/Link';
import { Divider } from '@material-ui/core';
import {Container,Image,  Row, Col}  from 'react-bootstrap'
import Typography from '@material-ui/core/Typography';
import {loadBlog} from '../../store/actions/blog';
import { connect } from 'react-redux';

export  class Blog extends Component {
    componentDidMount(){
        this.props.loadBlog()
        console.log(this.props.bdata)
      }
    render() {
        return (
            <Container>
            <div>
                <Divider />
                <div>
                    <div style={{ margin: '10px' }}>
                        <h1>Stories</h1>
                    </div>
                    <Row>
                        {this.props.blog.bdata?this.props.blog.bdata.map((data)=>{
                            return(
                                <Col>
                                <div style={{ width: '350px'}}>
                                    <Typography variant="h5" gutterBottom>
                                        {data.title}
                                    </Typography>
                                    <Typography variant="h6" gutterBottom>
                                        {data.meta_description}
                                    </Typography>
                                    <Image src="https://dynaimage.cdn.cnn.com/cnn/c_fill,g_auto,w_1200,h_675,ar_16:9/https%3A%2F%2Fcdn.cnn.com%2Fcnnnext%2Fdam%2Fassets%2F191120053137-03-milky-way-images-australia.jpg" style={{ width: '100%' }} rounded />
                                </div>
                            </Col>
                            )
                        }):""}
                    </Row>
                </div>
                <div>
                    <div style={{ margin: '10px' }}>
                        <h1>Stories</h1>
                    </div>
                        <Row>
                            <Col>
                                <div style={{ width: '350px'}}>
                                    <Typography variant="h5" gutterBottom>
                                        Google Nest
                                    </Typography>
                                    <Typography variant="h6" gutterBottom>
                                        subtitle1. Lorem ipsum dolor sit amet, consectetur 
                                    </Typography>
                                    <Image src="https://dynaimage.cdn.cnn.com/cnn/c_fill,g_auto,w_1200,h_675,ar_16:9/https%3A%2F%2Fcdn.cnn.com%2Fcnnnext%2Fdam%2Fassets%2F191120053137-03-milky-way-images-australia.jpg" style={{ width: '100%' }} rounded />
                                </div>
                            </Col>
                        </Row>
               </div>
               <div>
                    <div style={{ margin: '10px' }}>
                        <h1>All Stories</h1>
                    </div>
                    <div>
                        <Divider />
                        <Typography variant="h5" gutterBottom>
                            May 21 / Maps
                        </Typography>
                        <Typography variant="h3" gutterBottom>
                            subtitle1. Lorem ipsum dolor sit amet, consectetur 
                        </Typography>
                    </div>
               </div>
            </div>
            </Container>
        )
    }
}

const mapStateToProps = (state) => ({
    bdata: state.blog.bdata
  });



export default connect(mapStateToProps, {loadBlog})(Blog)
